import { Box, Paper } from "@material-ui/core";
import axios from "axios";
import { useEffect } from "react";

const Count = () => {
  useEffect(() => {
    axios.get("/api/count/getDashboardData");
  }, []);
  return (
    <Box m={5}>
      <Paper elevation={3} />

      <Paper />
    </Box>
  );
};

export default Count;
